import React from "react";
import {
  AddFirst,
  Overview,
  AddFirstTitle,
  AddFirstImage,
} from "./MainElements";
import { img } from "../../../../images/svg-13.svg";

const Main = () => {
  return (
    <>
      <AddFirst>
        <AddFirstImage src={img}></AddFirstImage>
        <AddFirstTitle></AddFirstTitle>
      </AddFirst>
      <Overview></Overview>
    </>
  );
};

export default Main;
